In nixpkgs, each package usually has a corresponding file associated with the packaging and related concerns of just that package. Early in nix's history, import was used to integrate the files with other expressions and allow for greater organization of code. However, the import model is quite explicit, and requires users to declare the dependencies twice. Below is an example expression for openssl: # pkgs/libraries/openssl/default.nix
{ lib, stdenv, fetchurl, perl }: stdenv.mkDerivation { ...
} In the import paradigm, the calling site would look: openssl = import ../libraries/openssl { inherit lib stdenv fetchurl perl; }; Obviously this isn't ideal. The dependencies need to be referred to three times, once at the call site, as inputs to the expression, and then within the expression at the appropriate section. The tediousness of passing the values will be solved by callPackage.

